import React from "react";
import { Link } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../assets/styles/all.css';
import '../assets/styles/main.css';

const Main = (props) => {
    return(
        <>
            <div>
                <div className="container">
                    <article className="start mt-5">
                        <h1 className="main-title mt-5 text-center">나와 어울리는 학과 TEST (수도권 전문대 ver.)</h1>
                        <article className="mt-5">
                            <img className="sub-title mt-5" alt="로고"/>
                            <h2 className="sub-title mt-3 text-center">2022년 대학 새내기가 되는 나!</h2>
                            <h2 className="sub-title mt-3 text-center">나와 어울리는 학과가 있는 수도권 전문대학교는 어딜까?🤔</h2>
                            <h2 className="sub-title mt-3 text-center">나와 어울리는 학과 TEST로 알아보자!</h2>
                        </article>
                        <div class="start-cover mt-5 mb-3">
                            <button type="button" class="btn-start btn btn-primary"><Link to="/test">START</Link></button>
                        </div>
                    </article>
                </div>
            </div>
        </>
    )
}

export default Main;
